import '../styles/Gallery.css';

export default function Gallery() {
    return (
        <div className='gallery'>
        <div className="text">
            <h2>Basic Ingredients</h2>
            <p>The essential ingredients that make up
            a majority of the featured plant-based recipes.</p>
        </div>

        </div>
    )
}
